"use strict";(self.webpackChunkmosquito_docs=self.webpackChunkmosquito_docs||[]).push([[1477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"R-D-avril-2022","metadata":{"permalink":"/blog/R-D-avril-2022","editUrl":"https://github.com/MosquitoOS/MosquitoOS.github.io/tree/master/blog/blog/2022-04-21-R-D-avril.md","source":"@site/blog/2022-04-21-R-D-avril.md","title":"Retours sur les quelques jours de R&D d\'avril 2022","description":"Du 11 au 16 avril, 6 membres du collectifs se sont retrouv\xe9s pr\xe8s des Gorges de l\u2019Aveyron (\xe0 Caylus) pour continuer \xe0 r\xe9fl\xe9chir, penser, am\xe9liorer le Mosquito OpenSource. Thibaut, est venu avec les pi\xe8ces qu\u2019il a lui-m\xeame r\xe9alis\xe9 de son c\xf4t\xe9 apr\xe8s le stage de novembre. Car oui, il y a d\xe9j\xe0 un 2e prototype en cours de r\xe9alisation (et sa r\xe9alisation est tr\xe8s belle !).","date":"2022-04-21T00:00:00.000Z","formattedDate":"April 21, 2022","tags":[{"label":"R&D","permalink":"/blog/tags/r-d"},{"label":"mosquito","permalink":"/blog/tags/mosquito"}],"readingTime":2.12,"truncated":false,"authors":[{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"}],"frontMatter":{"slug":"R-D-avril-2022","title":"Retours sur les quelques jours de R&D d\'avril 2022","authors":{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"},"tags":["R&D","mosquito"]},"nextItem":{"title":"Un trike qui roule et une documentation en ligne","permalink":"/blog/il-roule"}},"content":"Du 11 au 16 avril, 6 membres du collectifs se sont retrouv\xe9s pr\xe8s des Gorges de l\u2019Aveyron (\xe0 Caylus) pour continuer \xe0 r\xe9fl\xe9chir, penser, am\xe9liorer le Mosquito OpenSource. Thibaut, est venu avec les pi\xe8ces qu\u2019il a lui-m\xeame r\xe9alis\xe9 de son c\xf4t\xe9 apr\xe8s le stage de novembre. Car oui**, il y a d\xe9j\xe0 un 2e prototype en cours de r\xe9alisation** (et sa r\xe9alisation est tr\xe8s belle !).\\n\\nUn gros soucis de mise en \u0153uvre du premier prototype a \xe9t\xe9 mis \xe0 jour sur la connexion entre le cadre principale (si\xe8ge) et la \u201cdirection 4 barres\u201d arri\xe8re. Certaines pi\xe8ces vont \xeatre refaites. Cela met en lumi\xe8re l\u2019importance de l\u2019ex\xe9cution, notamment au niveau de la r\xe9sine, ainsi que la qualit\xe9 de certains bois.\\n\\nPremier test car\xe9nage fibre de verre/carton \ud83d\udce6\\n----------------------------------------------\\n\\nOn a toutes et tous en t\xeate l\u2019image du Mosquito original de Nicolas et Olivier avec ses magnifiques car\xe9nages en toile ou en bambou. La toile est d\u2019ailleurs le choix sur lequelle se sont pos\xe9s Elisabeth et Thibaut pour leur version du Mosquito. Mais dans l\u2019optique d\u2019avoir un v\xe9lomobile accessible au plus grand nombre, notamment du point vu technique, financier et de temps disponible, avec Nicolas il a \xe9t\xe9 discuter de **tester une version car\xe9nages \u201c\xe0 Bouchains\u201d avec des flans en cartons le tout r\xe9sin\xe9 \xe0 la fibre de verre**. Prix et mise en \u0153uvre imbattable (pas de moules ni de coutures complexes). Afin de tester ce mod\xe8le et sa r\xe9alisation concr\xe8te, un premier car\xe9nage \xe0 l\u2019\xe9chelle 1/2 a commenc\xe9 \xe0 \xeatre r\xe9alis\xe9. On vous tiens au courant d\u2019ici le mois de mai si \xe7a fonctionne. Le car\xe9nage a \xe9t\xe9 dessin\xe9 par Nicolas, mais on pourrait utiliser un code (merci cebd du forum velorizontal) pour g\xe9n\xe9rer le car\xe9nage en fonction de diff\xe9rentes morphologies.\\n\\n![](https://dim.mcusercontent.com/cs/5c34adf9c85700841f7de761f/images/f91c76e0-ca95-6dce-dc3b-ebb8bbbf4165.jpg?w=446&dpr=2)\\n\\n_Stratification int\xe9rieure de la partie tribord du car\xe9nage \xe0 l\u2019\xe9chelle 1:2._\\n\\nLe Mosquito aux Championnats du Monde ? \ud83c\udf0d\\n------------------------------------------\\n\\n**Du 15 au 17 juillet \xe0 Orgelet,** se d\xe9rouleront [les Championnats du monde de V\xe9lo Couch\xe9s](https://www.afvelocouche.fr/world-championships-2022-2). Ce serait un tr\xe8s bel objectif de pouvoir y montrer un prototype qui roule du Mosquito Open Source. On va encourager Thibaut pour qu\u2019il puisse finir sa version (tout de m\xeame plus belle que la premi\xe8re version de novembre il faut l\u2019admettre =). D\u2019ailleurs si vous \xeates dans la r\xe9gion d\u2019Avignon et que \xe7a vous dit de bricoler, il est ouvert \xe0 de l\u2019aide (c\u2019est Magic\\\\_Carpet(Tibo) sur le [chat Discord](https://discord.gg/6RPYG9WdNc) \ud83d\udcac).\\n\\n**Vous pouvez supporter cette venue** notamment en aidant le d\xe9fraiement pour l\u2019\xe9quipe pr\xe9sente [via la page de dons sur OpenCollective.](https://opencollective.com/mosquitoos) (dons r\xe9currents ou ponctuelles). \u2764"},{"id":"il-roule","metadata":{"permalink":"/blog/il-roule","editUrl":"https://github.com/MosquitoOS/MosquitoOS.github.io/tree/master/blog/blog/2022-03-07-il-roule.md","source":"@site/blog/2022-03-07-il-roule.md","title":"Un trike qui roule et une documentation en ligne","description":"\u2014In English below \u2014","date":"2022-03-07T00:00:00.000Z","formattedDate":"March 7, 2022","tags":[{"label":"stage","permalink":"/blog/tags/stage"},{"label":"mosquito","permalink":"/blog/tags/mosquito"}],"readingTime":1.555,"truncated":false,"authors":[{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"}],"frontMatter":{"slug":"il-roule","title":"Un trike qui roule et une documentation en ligne","authors":{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"},"tags":["stage","mosquito"]},"prevItem":{"title":"Retours sur les quelques jours de R&D d\'avril 2022","permalink":"/blog/R-D-avril-2022"},"nextItem":{"title":"Happy New Year 2022!","permalink":"/blog/bonne-annee-2022"}},"content":"\u2014In English below \u2014\\n\\nPremi\xe8re sortie du Mosquito OpenSource \ud83d\ude05\\n=========================================\\n\\nPresque 4 mois apr\xe8s le stage de Novembre dernier, le Trike du Mosquito (sans le car\xe9nage) a finalement fait ses premiers tours de p\xe9dales. Ci-dessous un courte vid\xe9o. Merci \xe0 la collaboration de 34 diff\xe9rentes mains qui ont su rendre cette r\xe9alisation possible, la plupart sans exp\xe9riences ant\xe9rieurs !\\n\\n[![](https://dim.mcusercontent.com/cs/5c34adf9c85700841f7de761f/images/f60f2721-945d-7ee7-1aa3-894546672445.png?w=480&dpr=2)](https://www.youtube.com/watch?v=CMnDJaUbB3I&list=PLrf-skLonSXrDJ3x7Lvvlt1rDBZ83i1BJ&index=1)\\n\\nLe [**site internet du Mosquito OpenSource**](https://mosquito-velomobiles.org/) a \xe9t\xe9 mis \xe0 jour ! L\u2019ensemble des fiches r\xe9alis\xe9es par les participants du stage de novembre sont en ligne. Le site se doit encore d\u2019\xeatre am\xe9lior\xe9, c\u2019est pr\xe9vu dans les prochains mois. _[Il est opensource auss](https://github.com/MosquitoOS/MosquitoOS.github.io/issues)i_, donc n\u2019h\xe9sitez pas \xe0 donner un coup de main si vous en avez les comp\xe9tences ;-)\\n\\nUn futur stage seront encore n\xe9cessaire pour compl\xe9ter et \u201cnettoyer\u201d les fiches. Envie de commencer \xe0 fabriquer le v\xf4tre ? N\u2019h\xe9sitez pas a venir en parler sur le Discord (Bravo \xe0 Thibault qui a d\xe9j\xe0 commenc\xe9!).\\n\\nLa fabrication de ce premier mod\xe8le \u201cauto-construit\u201d a mis en \xe9vidence quelques points d\u2019am\xe9lioration (porte-p\xe9dalier, diff\xe9rentes tailles de trike, essieux, utilisation d\u2019outils \xe0 commande num\xe9rique, \u2026). Dans ce cadre, un **\u201cstage R&D\u201d est organis\xe9 du 8 au 18 avril** \xe0 Caylus (Tarn-et-Garonne). Envie de r\xe9fl\xe9chir \xe0 l\u2019am\xe9lioration du Mosquito Opensource ? Rejoins nous sur le canal de discussion _**#stages-camps**_ du Discord (messagerie en ligne) pour avoir les infos.\\n\\nEnfin, [**une page de collecte de fond a \xe9t\xe9 ouverte**](https://opencollective.com/mosquitoos) sur OpenCollective (support de projets opensources). Il s\u2019agit d\u2019une plateforme transparente o\xf9 contributions et d\xe9fraiements sont lisibles par toutes et tous. La page doit encore \xeatre compl\xe9t\xe9e, mais vous pouvez d\u2019ores et d\xe9j\xe0, si vous le souhaitez, contribuer financi\xe8rement au projet.\\n\\n[Discord](https://discord.gg/rjzDM99289)\\n\\nHey there! [**The new website is online**](https://www.mosquito-velomobiles.org/), but online in French. [Help us to translate it!](https://github.com/MosquitoOS/MosquitoOS.github.io/issues/1) You are welcome on the Discord (there is a English channel, but we can add other languages too :)"},{"id":"bonne-annee-2022","metadata":{"permalink":"/blog/bonne-annee-2022","editUrl":"https://github.com/MosquitoOS/MosquitoOS.github.io/tree/master/blog/blog/2022-01-17-bonne-annee.md","source":"@site/blog/2022-01-17-bonne-annee.md","title":"Happy New Year 2022!","description":"**In English below**","date":"2022-01-17T00:00:00.000Z","formattedDate":"January 17, 2022","tags":[{"label":"R&D","permalink":"/blog/tags/r-d"},{"label":"Mosquito","permalink":"/blog/tags/mosquito"}],"readingTime":0.95,"truncated":false,"authors":[{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","imageURL":"https://github.com/dsmrs.png","key":"dsmrs"}],"frontMatter":{"slug":"bonne-annee-2022","title":"Happy New Year 2022!","authors":"dsmrs","tags":["R&D","Mosquito"]},"prevItem":{"title":"Un trike qui roule et une documentation en ligne","permalink":"/blog/il-roule"},"nextItem":{"title":"Retour sur le stage de novembre 2021","permalink":"/blog/camp-novembre-2021"}},"content":"_**In English below**_\\n\\n![](https://dim.mcusercontent.com/cs/5c34adf9c85700841f7de761f/images/d80872a5-da01-87b7-7c2d-b4ba2c35ce29.jpg?w=564&dpr=2&rect=0%2C8%2C2364%2C1756)\\n\\nL\u2019ann\xe9e commence fort pour le Mosquito: Romain, Laurent, Elisabeth, Joseph et Dorian se sont retrouv\xe9 dans le Sud-Ouest de la France pour terminer le trike Mosquito (oui oui, il reste le car\xe9nage \xe0 (re)faire). Il a \xe9t\xe9 assembl\xe9, mais malheureusement certaines pi\xe8ces ont manqu\xe9s, et certaines erreurs ont \xe9t\xe9 mises \xe0 nues, il n\u2019a donc pas encore roul\xe9. Mais quelle \xe9tape de voir ce trike mont\xe9. Rendez-vous les jeudis soir vers 18h (\xe0 partir du 27/01) sur le Discord pour continuer \xe0 voir l\u2019avancement du v\xe9lomobile.\\n\\nL\u2019\xe9quipe de mod\xe9lisation 3D a super bien avanc\xe9! Presque toutes les pi\xe8ces ont \xe9t\xe9 remod\xe9lis\xe9e sur FreeCAD. Il reste maintenant qu\u2019\xe0 les assembler. Vous pouvez retrouver l\u2019ensemble des fichiers 3D sur le r\xe9pertoire [GitHub](https://github.com/MosquitoOS/MosquitoOS).\\n\\nIl n\u2019y a pas a dire, 2022 sera l\u2019ann\xe9e du Mosquito =) On esp\xe8re pouvoir vous proposer tr\xe8s prochainement des dates pour un prochain \u201cStage Mosquito\u201d.\\n\\n[Join the Discord](https://discord.gg/XMSZgFDT)\\n\\nHey folks! We can speak other languages than French . Do you want to help to translate the documentation? Organizing a Mosquito Workshop in your country? Please join us on Discord or send us an email: doriansomers\\\\_at\\\\_gmail\\\\_dot\\\\_com."},{"id":"camp-novembre-2021","metadata":{"permalink":"/blog/camp-novembre-2021","editUrl":"https://github.com/MosquitoOS/MosquitoOS.github.io/tree/master/blog/blog/2021-12-12-camp-novembre.md","source":"@site/blog/2021-12-12-camp-novembre.md","title":"Retour sur le stage de novembre 2021","description":"On prends enfin le temps de venir vers vous avec quelles nouvelles =)","date":"2021-12-12T00:00:00.000Z","formattedDate":"December 12, 2021","tags":[{"label":"stage","permalink":"/blog/tags/stage"},{"label":"mosquito","permalink":"/blog/tags/mosquito"}],"readingTime":1.69,"truncated":false,"authors":[{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"}],"frontMatter":{"slug":"camp-novembre-2021","title":"Retour sur le stage de novembre 2021","authors":{"name":"Dorian Somers","title":"Equipe MosquitoOS","url":"https://github.com/dsmrs","image_url":"https://github.com/dsmrs.png","imageURL":"https://github.com/dsmrs.png"},"tags":["stage","mosquito"]},"prevItem":{"title":"Happy New Year 2022!","permalink":"/blog/bonne-annee-2022"}},"content":"On prends enfin le temps de venir vers vous **avec quelles nouvelles** =)\\n\\nDur de r\xe9sumer la semaine de fabrication de novembre dernier. S\u2019il fallait le faire en une suite de mots, se serait ainsi:\\n\\nDe tr\xe8s belles rencontres, apprentissages et \xe9changes, de la rigolade, une m\xe9t\xe9o bretonne , d\xe9couverte du v\xe9lo-couch\xe9 et v\xe9lomobile, de la bonne bouffe, la plage et un mosquito \u201cpresque\u201d fini.\\n\\nPresque fini ?? Et oui, malgr\xe9 la **motivation \xe9norme** des 14 participants et participantes de ce stage, nous n\u2019avons pas su finir \xe0 temps le mosquito. Mais **toutes les pi\xe8ces ont \xe9t\xe9 r\xe9alis\xe9es**, il ne manque plus que l\u2019assemblage final. Il faut dire qu\u2019en parall\xe8le un tr\xe8s gros boulot de documentation \xe0 eu lieu (et toujours en court). **Plus d\u2019infos quand ce sera finalis\xe9.**\\n\\n_**Note**_: Si vous habitez proche de [Caylus](https://goo.gl/maps/VrVM84wmiTLGrZM3A) (Occitanie) et que vous \xeates dispo les 7, 8, 9 et 10 janvier, vous pouvez venir donner un coup de main pour essayer de terminer le v\xe9lomobile. (m\u2019\xe9crire \xe0 l\u2019adresse suivante: doriansomers\\\\_at\\\\_gmail.com).\\n\\n[![](https://dim.mcusercontent.com/cs/5c34adf9c85700841f7de761f/images/a40e66c3-62cf-8d88-ceba-bd7898e07f16.jpg?w=564&dpr=2)](https://www.letelegramme.fr/finistere/quimper/a-nevez-les-premiers-tours-de-roues-d-un-velomobile-30-11-2021-12877806.php)\\n\\n_Le t\xe9l\xe9gramme, journal r\xe9gional breton, a fait [un article](https://www.letelegramme.fr/finistere/quimper/a-nevez-les-premiers-tours-de-roues-d-un-velomobile-30-11-2021-12877806.php) sur ces 7 jours de stage._\\n\\nEt la suite me direz-vous ? Avec Nicolas on est super partants pour r\xe9it\xe9rer l\u2019exp\xe9rience, restez inscrit(e)s \xe0 cette newsletter, on vous tiendra au courant du prochain stage. Pour vous pr\xe9parer psychologiquement:\\n\\n*   Il sera dans le Sud (on sait pas encore si Sud-Ouest ou Sud-Est)\\n    \\n*   Il sera un peu plus cher (l\u2019id\xe9e c\u2019est qu\u2019on puisse commencer \xe0 r\xe9mun\xe9rer au moins Nicolas, pour les centaines d\u2019heures de boulot)\\n    \\n*   au plus t\xf4t en avril, sinon \xe0 l\u2019\xe9t\xe9 2022 (on va essayer de fixer assez rapidement des dates)\\n    \\n\\nLa documentation OpenSource est toujours en court, on aura p-e besoin du 2e stage pour vraiment la finaliser. Un **groupe de travail sur la mod\xe9lisation 3D** s\u2019est form\xe9, envie de le rejoindre ? (\xe9cris moi \xe0 l\u2019adresse suivante: doriansomers\\\\_at\\\\_gmail.com) **prochain rdv visio: lundi 20 d\xe9cembre \xe0 10h.**\\n\\nEncore plein de possibilit\xe9s (crowdfunding, des kits de fabrication Mosquito \xe0 la vente, \u2026) mais c\u2019est pour plus tard."}]}')}}]);